import React, { useState } from 'react'
import { useHistory } from 'react-router'
import './Next.scss'

/**
* @author
* @function Next
**/
const date = new Date()
const yr = date.getFullYear()
const limit = yr - 19


const Next = (props) => {
    const history = useHistory()

    const verify_age = () => { 
      console.log(limit)
      console.log(props.verify_age)
      if(props.verify_age < limit){ 
        history.push(props.link)
      }
      // else(
      //   window.location.reload('https://google.com')
      // )
    }
    // Take two props - image and link
    const [background] = useState({
        style: { 
            backgroundColor: '#E14925',
            border: 'none', 
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center'
            // background: `url(${props.image}) no-repeat center center`,
            // backgroundSize: 'contain',

        },
        link: ''
    })

  return(
    <button onClick={verify_age} style={background.style} className={`next_btn ${props.class}`}>NEXT <img id='next_image' src={props.image} alt='' /></button>
   )

 }

export default Next
